// import React from 'react';    next已经包含了
import {Button } from 'antd'

import Router from 'next/router'

const events = [
  'routeChangeStart',
  'routeChangeComplete',
  'routeChangeError',
  'beforeHistoryChange',
  'hashChangeStart',
  'hashChangeComplete'
]

function makeEvent(type) {
  return (...args) => {
    console.log(type, ...args);

  }
}
events.forEach(event => {
  Router.events.on(event, makeEvent(event))
})

export default () => {

  function gotoTestB() {
    Router.push({
      pathname: '/b',
      query: {
        id: 2
      }
    },'/b/2')
  }
  return (
    <>
      <span>index</span>
    </>
  )
}
